import React, { useState, useEffect } from 'react';
import axios from 'axios';
import { Container, ListGroup } from 'react-bootstrap';

import './EmergenciesList.css';

const EmergenciesList = () => {
  const [emergencies, setEmergencies] = useState([]);

  useEffect(() => {
    const fetchData = async () => {
      const result = await axios.get('http://127.0.0.1:8000/emergencies/');
      setEmergencies(result.data);
    };
    fetchData();
  }, []);

  return (
    <Container className="emergencies-container">
      <h1>Emergencies</h1>
      <ListGroup className="emergencies-list">
        {emergencies.map(emergency => (
          <ListGroup.Item key={emergency.id} className="emergency-item">
            <strong>{emergency.description}</strong> - {emergency.location}
          </ListGroup.Item>
        ))}
      </ListGroup>
    </Container>
  );
};

export default EmergenciesList;
